import { Router } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import NewQuote from "./pages/NewQuotes";
import QuoteDetail from "./pages/QuoteDetail";

function App() {
  return (
    <div>
      <Router>
        <AllQuotes path="/all-quotes"/>
      </Router>
      <Router>
        <NewQuote path="/new-quotes"/>
      </Router>
      <Router>
        <QuoteDetail path="/all-quotes"/>
      </Router>

    </div>
  );
}

export default App;
